import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Authorization from './Authorization';
import PhoneCodeRegistration from './Pages/PhoneCodeRegistration';
import Registration from './Pages/Registration';
import { Stack } from '../../Navigation/Navigation';


const NavigationForAuthorization = () => {

    const navigateToRegistration = (navigation) => {
        navigation.navigate('Registration');
      };
      const navigateToPhoneCodeRegistration = (navigation) => {
        navigation.navigate('PhoneCodeRegistration');
      };
  return (
    <Stack.Navigator 
    initialRouteName="Authorization"
     screenOptions={{ 
        headerShown: false 
        }}>
    <Stack.Screen
      name="Authorization"
      component={Authorization}
      initialParams={{
        navigateToRegistration: navigateToRegistration,
        navigateToPhoneCodeRegistration: navigateToPhoneCodeRegistration,
      }}
    />
    <Stack.Screen name="PhoneCodeRegistration" component={PhoneCodeRegistration} />
    <Stack.Screen name="Registration" component={Registration} />
  </Stack.Navigator>
  );
};

export default NavigationForAuthorization;
